# Kolob, Untsukulsky District, Republic of Dagestan

}}
Kolob () is a rural locality (a selo) in Ishtiburinsky Selsoviet, Untsukulsky District, Republic of Dagestan, Russia. Population:
Geography
Kolob is located 37&nbsp;km west of Shamilkala (the district's administrative centre) by road. Ishtiburi is the nearest rural locality.
